import React from 'react';
import './App.css'
import Sidebar from './components/Sidebar';
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import ProjectStatus from './pages/ProjectStatus.jsx';
import Home from './pages/Home.jsx';
import UpdateEmployee from './pages/UpdateEmployee.jsx';
import RemoveEmployee from './pages/RemoveEmployee.jsx';
import Completed from './pages/Completed';
import OnProcess from './pages/OnProcess';
import Header from './components/Header';
import Footer from './components/Footer';
import LogOut from './pages/LogOut';


function App() {
  return (
    <div className='page-container'>
      <div className='content-wrap'>
        <Header />
        <BrowserRouter>
          <Sidebar />
          <Routes>
            <Route path='/' element={<Home />}></Route>
            <Route path='/Home' element={<Home />}></Route>
            <Route path='/ProjectStatus' element={<ProjectStatus />}></Route>
            <Route path='/ProjectStatus/Completed' element={<Completed />}></Route>
            <Route path='/ProjectStatus/OnProcess' element={<OnProcess />}></Route>
            <Route path='/UpdateEmployee' element={<UpdateEmployee />}></Route>
            <Route path='/RemoveEmployee' element={<RemoveEmployee />}></Route>
            <Route path='/LogOut' element={<LogOut />}></Route>
          </Routes>
        </BrowserRouter>
        <Footer />
      </div>
    </div>
  )
}

export default App;
